INSERT INTO basked_db.spr_countries_details (id, country_id, name, descr, created_at, updated_at, url, img_flag, img_gerb) VALUES (4, 4, null, 'Республика Албания (Republika e Shqipërisë) — государство в Центральной Европе, расположенное в западной части Балканского полуострова. Имеет государственные границы с шестью странами: на юго-западе с Италией (по морю), на северо-западе с Черногорией, на северо-востоке с Сербией и Косово, на востоке с Македонией, на юго-востоке с Грецией.', '2020-02-13 13:14:55', '2020-02-13 13:14:55', '/countries/albania', 'https://gtmarket.ru/files/flags/Flag_of_Albania.png', null);
INSERT INTO basked_db.spr_countries_details (id, country_id, name, descr, created_at, updated_at, url, img_flag, img_gerb) VALUES (5, 5, null, 'Алжирская Народная Демократическая Республика (الجمهورية الجزائرية الديمقراطية الشعبية) — государство в Северной Африке. Имеет государственные границы с шестью странами: на западе с Марокко, на юго-западе с Мавританией и Мали, на юго-востоке с Нигером, на востоке с Ливией и Тунисом. Занимает первое место в Африке по размеру территории, однако основная её часть не заселена, так как расположена в пустыне Сахара.', '2020-02-13 13:14:56', '2020-02-13 13:14:56', '/countries/algeria', 'https://gtmarket.ru/files/flags/Flag_of_Algeria.png', null);
INSERT INTO basked_db.spr_countries_details (id, country_id, name, descr, created_at, updated_at, url, img_flag, img_gerb) VALUES (6, 6, null, 'Республика Ангола (República de Angola) — государство в Юго-Западной Африке. Имеет государственные границы с четырьмя странами: на севере с Республикой Конго, на юге с Намибией, на востоке с Замбией, на северо-востоке с Демократической Республикой Конго.', '2020-02-13 13:14:57', '2020-02-13 13:14:57', '/countries/angola', 'https://gtmarket.ru/files/flags/Flag_of_Angola.png', null);
